import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();

var addAudit = function() {
    var elemKod = document.querySelector('.mx-section').innerHTML;
    var elemOutKod = document.querySelector('.mx-fake');

    elemOutKod.innerHTML += '<div>' + elemKod + '</div>';
};

document.onclick = function() {
    var elem = window.event.srcElement;
    if (elem.className === "mx-new-b") {
        addAudit();
    }
};

let li = document.querySelectorAll('#testUl .mx-main');
for (var i = 0, len = li.length; i < len; i++) {
  li[i].onclick = function() {
    console.log('parentNode', this.parentNode);
    console.log('element => this', this);
    this.parentNode.removeChild(this);
  }
}
